import ReactDOM from 'react-dom';

let UserList = (props) => {
  console.log(props);
  return <div> {props.person1.name} and {props.person2.name}</div>
}

class App extends React.Component{
  render(){
    const person1 = {
      name: "Adilet"
    }
    const person2 = {
      name: "Asan"
    }
    return  <UserList person1={person1} person2={person2}/>
  }
}

ReactDOM.render(
  <App/>,
  document.getElementById('root')

);
